              occaecat cupidatat non proident, sunt in culpa qui officia
              deserunt mollit anim id est laborum.</p>
            </div>
            <div css={imagecontainer}>
              <h2>HOBBIES</h2>
              <div css={hobbies}>
                <img src="/golf.jpg"/>
                <h3>Golfing</h3>
              </div>
              <div css={hobbies}>
                <img src="/hike.jpg"/>
                <h3>Hiking</h3>
              </div>
              <div css={hobbies}>
                <img src="/wakeboard.jpg"/>
                <h3>Water Sports</h3>
              </div>
              <div css={hobbies}>
                <img src="/camping.jpg"/>
                <h3>Camping</h3>
              </div>
            </div>
          </div>
        </div>
    </Layout>
  );
}

